import React from 'react';
import styled from 'styled-components';
import Logo from '../header/Logo.js';

import {
  Switch,
  Route,
  Link,
} from 'react-router-dom';

const LoginPageS = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  display: flex;

  margin-top: 300px;
`;

function Header({ children }) {

  return <LoginPageS>
      <Logo>48px</Logo>
    </LoginPageS>
}

export default Header;
